import React, { Component } from 'react';

const Project = (props) => {
    return (
        <div className="card">
            <h4>{props.title}</h4>
            <img width="120px" className="center" src={props.img} alt="fial"/>
            <p>{props.desc}</p>

            <div className="containerbtns flex-horizontal space-between">
            <a target="_blank" href={props.projectLink}> View Project</a>
            
            <a target="_blank" href={props.codeLink}> View Code</a>
            </div>
        </div>
    )
}

export default Project
